            return ComponentTemplate({
              className: componentName,
            });
          })
          .join('\n');
      })
      .filter(Boolean)
      .join('\n');
    const replacedTemplate = FileTemplate({
      componentDescriptors,
      libraryName,
    });
    return new Map([[fileName, replacedTemplate]]);
  },
};
